import React, { Component } from "react";
import { me } from "../../img/profilePic.jpg";

class Form extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div id="mainPic">
            <img src={me} alt="Profile pic"></img>
          </div>
        </div>
        <div className="row">
          <div id="mainContent">
            <div className="col-med-6">
              <h1>Travis Lloyd</h1>
              <h2>Travislloyd@lloyddm.com</h2>
              <h2>661-414-4027</h2>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Form;
